import Typography from '@mui/material/Typography';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import Box from '@mui/material/Box';
import React  from 'react';
import '../../App.css';
import { Stack } from '@mui/system';

const Write: React.FC = () => {
    return (
    <div className='writeform'>
        <Box sx={{ display: 'flex',
                   position:'relative', 
                   width:800, 
                   height:700,
                   margin:'auto', 
                   textAlign:'center', 
                   border: 1, 
                   borderRadius: 5, 
                   backgroundColor:'#ffffff', 
                   flexDirection: 'column', 
                   mt:5,
                   px:5,
                }}
        >
            <Stack direction='column' margin="auto" >
                <TextField id="company-name" label="기업명" variant="outlined" size="small" sx={{ width:700, }} margin="dense"/>
                <TextField id="company-url" label="홈페이지주소" variant="outlined" size="small" sx={{ width:700, }} margin="dense"/>
                <TextField id="company-impomation" label="기업정보" variant="outlined" size="small" sx={{ width:700, }} margin="dense"/>
                <TextField id="company-ceo" label="대표" variant="outlined" size="small" sx={{ width:700, }} margin="dense"/>
                <TextField id="company-adress" label="주소" variant="outlined" size="small" sx={{ width:700, }} margin="dense"/>
                <TextField id="company-content" label="기업내용" variant="outlined" size="small" sx={{ width:700, height:200 }} margin="dense"/>
                <input type="file" id="fileUpload" />
                <br/>
                <Button variant="outlined" sx={{ color:'#ffff', backgroundColor: '#26a69a', borderColor:'#434343'}}>
                        작성
                </Button>
            </Stack>
        </Box>
    </div>

);
}
export default Write;
